  return (
    <div>
        <div className="absolute">
        <img src={myImage} alt="Illustration of a person logging into the system" className="w-full max-w-lg mx-auto mt-8 rounded-xl shadow-lg"/>
        {/* <div className="absolute top-44 left-96 w-1/2 h-1/2 bg-white drop-shadow-xl rounded-2xl">
        </div> */}
        </div>
    </div>
  )
}

export default LoginComp;
